import React from "react";
import "./Navbar.css";
import { ReactSVG } from "react-svg";

function Navbar() {
	return (
		<nav>
			<div className='first-part'>
				<div className='nav-item'>
					<ReactSVG
  afterInjection={(svg) => {
    console.log(svg)
  }}
  beforeInjection={(svg) => {
    svg.classList.add('svg-class-name')
    svg.setAttribute('style', 'width: 200px')
  }}
  className="wrapper-class-name"
  desc="Description"
  evalScripts="always"
  fallback={() => <span>Error!</span>}
  httpRequestWithCredentials={true}
  loading={() => <span>Loading</span>}
  onClick={() => {
    console.log('wrapper onClick')
  }}
  onError={(error) => {
    console.error(error)
  }}
  renumerateIRIElements={false}
  src="svg.svg"
  title="Title"
  useRequestCache={false}
  wrapper="span"
/>
				</div>
				<div className='nav-item'>New Thread</div>
				<div className='nav-item'>Home</div>
				<div className='nav-item'>Discover</div>
				<div className='nav-item'>Library</div>
				<div className='nav-item'>Login</div>
				<div className='nav-item'>Sign Up</div>
			</div>
			<div className='second-part'>
				<div>TryPro</div>
				<div>
					Upgrade to Claude-2 or GPT-4, boost your Copilot uses, and upload more
					files.
				</div>
			</div>
		</nav>
	);
}

export default Navbar;
